export default function App() {
  return (
      <div className="App">
        <Nav />
        <Routes>
          <Route path="/" element ={<Home />} />
          <Route path="/source-code" component={<Source />} />
          <Route path="/about" component={<About />} />
          <Route path="/developer" component={<Developer />} />

        </Routes>
      </div>
  );
}
